import React from "react";
import PostJobsComponent from "./components/postJobComponent";
import FindJobsComponent from "./components/findJobsComponent";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div>
      <BrowserRouter>
          <PostJobsComponent />
          <FindJobsComponent />
      </BrowserRouter>
    </div>
  );
}

export default App;
